import React from 'react'
import s from '../Product/style.module.css'

export default function({id, title, price, deleteStatus}) {

  return (
    <div className={s.item}>
        <p>{title}</p>
        <p>{price}</p>
        <button className={s.button} onClick={() => deleteStatus(id)} >Delete</button>
    </div>
  )
}
